import { createIcon } from "../icon/createIcon";

export const ImportIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="ImportIcon">
    <path d="M7 11v-1h3V2H7V1h4v10H7z" />
    <path d="m5 3 4 2.985L5 9l-.001-2.02H0V4.99h4.999L5 3z" />
  </svg>,
  "Import",
  "import"
);
